    const { 
        className,
        answers
    } = props;

    return (
        <div className={ClassNames(cls.checkboxAnswers, {}, [className])}>
            {
                answers.map(answer => (
                    <Checkbox text={answers} />
                ))
            }
        </div>
 );
}
